 Inexigibilidade de licitação (art. 74, inc III, alínea “f” da Lei 14.133/2021), fim contratação da empresa Supreme Capacitação e Treinamento Ltda., para a prestação de serviços técnicos especializados de treinamento, consistentes na realização do curso presencial “Os Sistemas SIAPE/SIGEPE e e-SIAPE com Ênfase na Folha de Pagamento”, a ser ministrado em Brasília/DF, no período de 15 a 17 de dezembro de 2025, com carga horária total de 24 horas, conforme condições e exigências estabelecidas no TR Atualmente, sete operadores utilizam o sistema diariamente para processamento de dados sensíveis envolvendo:
            ? cadastramento e alterações em folhas de pagamento;
            ? dados funcionais de pensionistas e veteranos;
            ? direitos previdenciários e indenizatórios;
            ? rotinas que impactam diretamente a legalidade da despesa pública e o risco operacional.
Trata-se de atividade-fim crítica, que exige atuação segura e domínio técnico integral. A ausência de capacitação adequada pode gerar:
            ? erros de processamento;
            ? pagamentos indevidos ou incompletos;
            ? responsabilização funcional;
            ? retrabalho e atrasos;
            ? risco reputacional;
            ? fragilização do controle interno.
Ademais, a constante atualização normativa e normativa sistêmica do SIAPE/SIGEPE torna indispensável que os operadores possuam treinamento atualizado e homogêneo.
Assim, o serviço possui caráter essencial ao interesse público, com impacto direto sobre a continuidade, segurança e eficiência das atividades finalísticas do SVPM.
